@Cansu__Koca Hello Martin, please contact the Luggage department as soon as posible, if you are in Catania, please try our Italy line: 199 101 191
They should keep you posted and you need to insist with them.
Regards

@wikkimen Hola José, disculpa la demora en contestar...
Tendría que ser en el equipaje de mano, pues no está permitido facturar nada que contenga baterías de litio en bodega.
Saludos

@marlorenna84 Hola Mar, si cuando compraste tus billetes de Vueling no incluiste tu número de IBPLUS, ya no puedes solicitar los Avios de esos billetes. De los billetes de Iberia, por favor solicita tus Avios en:
https://t.co/k6H0ZOxUfS
Saludos. https://t.co/DrK23hb60l

@garcalo Hola Gorka, Para solicitar mayores detalles podrás contactar con tu Centro de atención de equipajes vía telefónica, desde España al 
901 111 342  y de cualquier otro país al 
+34 91 389 43 57  y +34910714468 marcando desde Skype si así lo prefieres. Saludos

@vivdos Hola Viviana, disculpas por la demora en contestar y lo sucedido, por favor comunícate con el departamento de Equipajes con el número PIR que te entregaron en el aeropuerto a la línea: 199 101 191
De lunes a domingo 00:00 - 24:00h (español e inglés) 
Gracias y saludos

@caniknows Desde ahí se están acomodando a aquellos pasajeros que tenían conexiones a otra ciudades.
Saludos
2/2

@caniknows Hola, todos los pasajeros del vuelo IB6856 están en perfectas condiciones, incluso el pasajero que tuvo la emergencia médica está siendo debidamente atendido. 
¿Cuál era el destino final de tus padres? El avión aterrizó en Madrid a las 9:39 de la mañana. 
1/2

@fizzyboobalech Hello Israel, we apologize for all inconveniences within your trip, please fill out your claim at:
https://t.co/a8YGMUYnqb
thanks for your patience. Regards. https://t.co/DrK23hb60l

@SergioRocaRomer Hola Sergio, por favor ingresa tu reclamación en el siguiente enlace:
https://t.co/bxvkDPihwf
incluye la foto que nos envías, selecciona como motivo "otros", porque no tienes un PIR con el cual registrarlo como equipaje. Saludos. https://t.co/DrK23hb60l

@jarq345 Hola! gracias por contactarnos, en gestión de reserva selecciona tu vuelo y  la opción "cambios", o contacta a Serviberia en:
