@pugagmail Hola, lamentamos el inconveniente con la maleta de mano, por favor si registraste tu reclamación en el Aeropuerto envíanos el código PIR que te enviaron para darle seguimiento (DM), o ingresa al siguiente link:
https://t.co/ovEAoOEAwy
Saludos. https://t.co/DrK23hb60l

@marcomicciche72 Hola Marco, no se trata de espacio, es una política de seguridad, el equipaje de mano de puede exceder de ciertas medidas y cierto peso. 
Si deseas saber más, te dejamos este enlace: https://t.co/AxlRZHny1i
Saludos

@therealpablors Hola, disculpa la demora en contestar. ¿Pudiste realizar los cambios? La única vía para realizar cambios es la telefónica.
